namespace RonSijm.FluidHumidifier.Factories.QuickSight;

public class TemplateFactory(string resourceName = null, Action<Humidifier.QuickSight.Template> factoryAction = null) : ResourceFactory<Humidifier.QuickSight.Template>(resourceName)
{

    internal List<InnerTemplateResourcePermissionFactory> PermissionsFactories { get; set; } = [];

    internal InnerTemplateTemplateSourceEntityFactory SourceEntityFactory { get; set; }

    internal InnerTemplateTemplateVersionDefinitionFactory DefinitionFactory { get; set; }

    internal InnerTemplateValidationStrategyFactory ValidationStrategyFactory { get; set; }

    protected override Humidifier.QuickSight.Template Create()
    {
        var templateResult = CreateTemplate();
        factoryAction?.Invoke(templateResult);

        return templateResult;
    }

    private Humidifier.QuickSight.Template CreateTemplate()
    {
        var templateResult = new Humidifier.QuickSight.Template
        {
            GivenName = InputResourceName,
        };

        return templateResult;
    }
    public override void CreateChildren(Humidifier.QuickSight.Template result)
    {
        base.CreateChildren(result);

        result.Permissions = PermissionsFactories.Any() ? PermissionsFactories.Select(x => x.Build()).ToList() : null;
        result.SourceEntity ??= SourceEntityFactory?.Build();
        result.Definition ??= DefinitionFactory?.Build();
        result.ValidationStrategy ??= ValidationStrategyFactory?.Build();
    }

} // End Of Class

